&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">Форма позволяет следить за&amp;nbsp;активными звонками, управляемыми радиус-процессом. &lt;br />
Если вы&amp;nbsp;выбрали конкретного оператора, то&amp;nbsp;можете выбрать у&amp;nbsp;него конкретный ip-адрес для&amp;nbsp;просмотра.&lt;br />
