&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelCallsInfo/FormaRadiusOnlineCalls&amp;amp;v=1g4" class="">/Документация&amp;nbsp;IP&amp;nbsp;Studio&amp;nbsp;AMBS&amp;nbsp;/&amp;nbsp;Раздел&amp;nbsp;Calls&amp;nbsp;Info&amp;nbsp;/&amp;nbsp;Форма&amp;nbsp;Radius&amp;nbsp;Online&amp;nbsp;Calls&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelCallsInfo/FormaRadiusOnlineCalls&amp;amp;time=2007-04-11+17%3A03%3A55">2007-04-11 17:03:55&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelCallsInfo/FormaRadiusOnlineCalls&amp;amp;time=2007-06-15+17%3A57%3A00">2007-06-15 17:57:00&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">&lt;br />
Форма позволяет следить за&amp;nbsp;активными звонками управляемыми радиус-процессом. &lt;br />
На&amp;nbsp;основании данных из&amp;nbsp;этой формы работает параметр &amp;#147;capacity&amp;#148; для&amp;nbsp;направлений оригинирующих и&amp;nbsp;терминирующих операторов. &lt;br />
Параметр &amp;#147;capacity&amp;#148; указывается для&amp;nbsp;направлений в&amp;nbsp;тарифных планах операторов (Tariffs &amp;gt; Edit tariffs). &lt;br />
Внешний вид&amp;nbsp;формы : &lt;br />
&lt;br />
 &lt;br />
&lt;br />
&lt;br />
Форма раздела состоит из&amp;nbsp;следующих полей:&lt;br />
&lt;br />
&lt;table class="dtable" border="0">
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Поле&lt;/strong>&lt;/td>&lt;td  class="usercell">&lt;strong>Назначение&lt;/strong>&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell" colspan="2">&lt;hr noshade="noshade" size="1" />&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Select originate operator&lt;/strong>&lt;/td>&lt;td  class="usercell">Вы можете выбрать конкретного оригинирующего оператора для&amp;nbsp;просмотра только его&amp;nbsp;звонков.&lt;br />
&lt;!--notypo-->&lt;!--/notypo-->&lt;br />
&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Select originate ip&lt;/strong>&lt;/td>&lt;td  class="usercell">Если вы&amp;nbsp;выбрали конкретного оператора, то&amp;nbsp;вы можете выбрать у&amp;nbsp;него конкретный ip-адрес для&amp;nbsp;просмотра.&lt;br />
&lt;!--notypo-->&lt;!--/notypo-->&lt;br />
&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Select terminate operator&lt;/strong>&lt;/td>&lt;td  class="usercell">Вы можете выбрать конкретного терминирующего оператора для&amp;nbsp;просмотра только его&amp;nbsp;звонков.&lt;br />
&lt;!--notypo-->&lt;!--/notypo-->&lt;br />
&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Select terminate ip&lt;/strong>&lt;/td>&lt;td  class="usercell">Если вы&amp;nbsp;выбрали конкретного оператора, то&amp;nbsp;вы можете выбрать у&amp;nbsp;него конкретный ip-адрес для&amp;nbsp;просмотра.&lt;br />
&lt;!--notypo-->&lt;!--/notypo-->&lt;br />
&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Enter destination number&lt;/strong>&lt;/td>&lt;td  class="usercell">Если требуется получить лист звонков, начинающихся на&amp;nbsp;определенные цифры кода, то&amp;nbsp;в поле нужно ввести эти&amp;nbsp;цифры.&lt;br />
&lt;!--notypo-->&lt;!--/notypo-->&lt;br />
&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Refresh time (sec.)&lt;/strong>&lt;/td>&lt;td  class="usercell">Время обновления информации, как&amp;nbsp;часто AMBS будет забирать данные с&amp;nbsp;MVTS-сервера. Не&amp;nbsp;рекомендуется ставить значение меньше 10 секунд, может привести к&amp;nbsp;зависанию MVTS-сервера.&lt;br />
&lt;!--notypo-->&lt;!--/notypo-->&lt;br />
&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Data format&lt;/strong>&lt;/td>&lt;td  class="usercell">Тип вывода на&amp;nbsp;экран данных. &lt;br />
Может принимать три&amp;nbsp;значения:&lt;br />
&lt;strong>detail&lt;/strong> &amp;ndash; Будет выдаваться полная детальная информация в&amp;nbsp;виде списка звонков.&lt;br />
&lt;strong>summary&lt;/strong> &amp;ndash; Суммарная статистика в&amp;nbsp;виде двух полей: количество нулевых звонков и&amp;nbsp;не нулевых.&lt;br />
&lt;strong>summary operator&lt;/strong> &amp;ndash; Суммарная статистика по&amp;nbsp;операторам. Сколько сейчас проходит звонков от&amp;nbsp;каждого оператора.&lt;br />
&lt;!--notypo-->&lt;!--/notypo-->&lt;br />
&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Originated destinations&lt;/strong>&lt;/td>&lt;td  class="usercell">Название направления по&amp;nbsp;оригинационному тарифу оператора&lt;br />
