&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Originate price&lt;/strong>&lt;/td>&lt;td  class="usercell">Цена оригинации данного звонка.&lt;br />
&lt;!--notypo-->&lt;!--/notypo-->&lt;br />
&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Source number&lt;/strong>&lt;/td>&lt;td  class="usercell">Номер вызывающего абонента.&lt;br />
&lt;!--notypo-->&lt;!--/notypo-->&lt;br />
&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Terminate operator&lt;/strong>&lt;/td>&lt;td  class="usercell">Показывать терминирующего оператора.&lt;br />
