&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Destination ip&lt;/strong>&lt;/td>&lt;td  class="usercell">Показывать адрес получателя.&lt;br />
&lt;!--notypo-->&lt;!--/notypo-->&lt;br />
&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Terminate price&lt;/strong>&lt;/td>&lt;td  class="usercell">Цена терминации данного звонка. &lt;br />
&lt;!--notypo-->&lt;!--/notypo-->&lt;br />
&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Destination number&lt;/strong>&lt;/td>&lt;td  class="usercell">Номер вызываемого абонента.&lt;br />
&lt;!--notypo-->&lt;!--/notypo-->&lt;br />
&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Elapsed time&lt;/strong>&lt;/td>&lt;td  class="usercell">Прошедшее время с&amp;nbsp;начала звонка.&lt;br />
&lt;!--notypo-->&lt;!--/notypo-->&lt;br />
&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Callid&lt;/strong>&lt;/td>&lt;td  class="usercell">Идентификатор звонка.&lt;br />
&lt;!--notypo-->&lt;!--/notypo-->&lt;br />
&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Confid&lt;/strong>&lt;/td>&lt;td  class="usercell">Идентификатор конфигурации, которая использовалась для&amp;nbsp;звонков.&lt;br />
