&lt;/td>&lt;/tr>
&lt;tr class="userrow">&lt;td class="usercell">&lt;strong>Terminated destinations&lt;/strong>&lt;/td>&lt;td  class="usercell">Название направления по&amp;nbsp;терминационному тарифу оператора.&lt;br />
